import React from 'react';
import { Menu, Segment, Header, Grid, Container } from 'semantic-ui-react';

export default function Head() {
  const navData = ['Home', 'Pokemon', 'About Me'];
  const menu = navData.map((item, i) => {
    return (
      <Menu.Item key={i} name={item} as='a'>
        {item}
      </Menu.Item>
    );
  });
  return (
    <Grid inverted>
    <Grid.Row>
      <Menu secondary inverted pointing style={{ margin: 0, fontSize: 15 }}>
        {menu}
        <Menu.Item position='right' style={{ fontSize: 30, color: 'red' }}>
          Pokemon
        </Menu.Item>
      </Menu>
    </Grid.Row>
    </Grid>
  );
}
